  [],\n\t\"revision_timestamp\": \"2016-07-27T23:06:32.212729\",\n\t\"name\": \"sullys-hill-ngp-2006-bison-germplasm-conservation-plan\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Logistics for the plan to carry out germplasm
  conservation of bison in Region 6 and the U.S. Fish and Wildlife Service.  It starts
  out with an effort to move all Sully's Hill bison to Ft. Niobrara National Wildlife
  Refuge and to replace \"pure\" bison back into Sully's Hill National Game Preserve.
  The first goal of this project pertains to the legal mandates which legislated certain
  refuges to protect andperpetuate bison as a trust species. Sully's Hill must continue
  to carry out its designated purpose, mission, and objectives by maintaining a bison
  herd per this legislation. The second goal focuses on the conservation and restoration
  of a native species. To efficiently achieve these goals, adequate communications
  and planning are necessary. Essential details of the transfer and introduction of
  bison are documented in this plan.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
